import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router, 
Routes,
Route,
PrivateRoute,
} from 'react-router-dom';

import MainComponent from './components/MainComponent/MainComponent';

//componentes
import CompShowBlog from './components//blog/showBlog';
import Prueba from './components/Pruebas/prueba';
import Prueba2 from './components/Pruebas/prueba2';
import Usurio from './components/Pruebas/user';


function App() {
  return (
    <div>
      <Router>
        <MainComponent></MainComponent>
          <Routes>
            <Route path={'/'} exact  component={<CompShowBlog/>}/>
            <Route path={'/user'} exact  element={<Usurio/>}/>
            <Route path={'/prueba'} exact  element={<Prueba/>}/>
            <Route path={'/prueba2'} exact  element={<Prueba2/>}/>
          </Routes>
      </Router>
    </div>
  );
}


function Content() {
  return(
    <div>
      <Routes>
          <Route path={'/'} element={<div>Home</div>}></Route>
          <Route path={'/dashboard'} element={<div>DashBoard</div>}></Route>
          <Route path={'/user'} element={<div>User</div>}></Route>
          <Route path={'/etc'} element={<div>etc</div>}></Route>
          <Route path={'/salir'} element={<div>salir</div>}></Route>
      </Routes>
    </div>
  )
}

export default App;
